INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 102301, 0.0, 0.0, "2020/07/31 12:00:00", "アヤネ", 2, 24001, 10046, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 401, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 102301, 2.21, 0.0, "2020/07/31 12:00:00", "アヤネ", 1, 24002, 10046, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2, 402, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 102301, 0.0, 0.0, "2020/07/31 12:00:00", "アヤネ", 2, 24003, 10046, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 403, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192201, 1.99, 0.0, "2020/07/31 12:00:00", "アサヒ", 2, 24004, 10046, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1, 701, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192201, 2.21, 0.0, "2020/07/31 12:00:00", "アサヒ", 1, 24005, 10046, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2, 702, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192201, 3.33, 0.0, "2020/07/31 12:00:00", "アサヒ", 2, 24006, 10046, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 1, 703, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192301, 0.0, 0.0, "2020/07/31 12:00:00", "部員３", 2, 24007, 10046, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 801, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192301, 2.68, 0.0, "2020/07/31 12:00:00", "部員３", 1, 24008, 10046, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2, 802, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192301, 0.0, 0.0, "2020/07/31 12:00:00", "部員３", 2, 24009, 10046, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 803, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192501, 0.0, 0.0, "2020/07/31 12:00:00", "", 1, 24010, 10046, 0.0, "やった！", 1, 501, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192501, 0.0, 0.0, "2020/07/31 12:00:00", "", 1, 24011, 10046, 0.0, "勝ったよ！", 1, 502, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192501, 0.0, 0.0, "2020/07/31 12:00:00", "", 1, 24012, 10046, 0.0, "いい調子！", 1, 503, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113501, 5.33, 0.0, "2020/07/31 12:00:00", "ミサト", 6, 24013, 10046, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 2, 111, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113501, 6.85, 0.0, "2020/07/31 12:00:00", "ミサト", 1, 24014, 10046, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 2, 112, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113501, 3.0, 0.0, "2020/07/31 12:00:00", "ミサト", 1, 24015, 10046, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 2, 113, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192401, 6.11, 0.0, "2020/07/31 12:00:00", "ダイチ", 1, 24016, 10046, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 2, 611, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192401, 6.75, 0.0, "2020/07/31 12:00:00", "ダイチ", 1, 24017, 10046, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 2, 612, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192401, 0.0, 0.0, "2020/07/31 12:00:00", "ダイチ", 2, 24018, 10046, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 613, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113401, 4.52, 0.0, "2020/07/31 12:00:00", "ハツネ", 2, 24019, 10046, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 1, 211, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113401, 3.89, 0.0, "2020/07/31 12:00:00", "ハツネ", 2, 24020, 10046, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 1, 212, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113401, 13.49, 0.0, "2020/07/31 12:00:00", "ハツネ", 1, 24021, 10046, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 2, 213, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 106501, 3.17, 0.0, "2020/07/31 12:00:00", "カヤ", 1, 24022, 10046, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 2, 311, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 106501, 4.42, 0.0, "2020/07/31 12:00:00", "カヤ", 1, 24023, 10046, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 2, 312, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 106501, 2.89, 0.0, "2020/07/31 12:00:00", "カヤ", 6, 24024, 10046, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 1, 313, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 102301, 3.71, 0.0, "2020/07/31 12:00:00", "アヤネ", 4, 24025, 10046, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3, 421, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192201, 5.1, 0.0, "2020/07/31 12:00:00", "アサヒ", 2, 24026, 10046, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 1, 721, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192301, 4.34, 0.0, "2020/07/31 12:00:00", "部員３", 1, 24027, 10046, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 3, 821, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 192501, 0.0, 0.0, "2020/07/31 12:00:00", "", 1, 24028, 10046, 0.0, "いい勝負だったよ\nまたやろうね", 1, 521, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113501, 5.62, -360.0, "2020/07/31 12:00:00", "ミサト", 1, 24029, 10046, 0.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 2, 101, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113501, 9.58, -360.0, "2020/07/31 12:00:00", "ミサト", 1, 24030, 10046, 0.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 2, 102, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113501, 0.0, -360.0, "2020/07/31 12:00:00", "ミサト", 2, 24031, 10046, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 103, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113501, 9.13, -360.0, "2020/07/31 12:00:00", "ミサト", 2, 24032, 10046, 0.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 1, 104, "2030/12/17 14:59:59");
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (24, 113501, 8.27, -360.0, "2020/07/31 12:00:00", "ミサト", 1, 24033, 10046, 0.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 2, 105, "2030/12/17 14:59:59");
